import React from "react";

function Galery() {
  return (
    <div className="galery container">
      <div className="galery-box">

        <div className="galery-item">
          <img src="https://images.unsplash.com/photo-1625296048730-ada61dcf378b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"/>
        </div>

        <div className="galery-item">
          <img src="https://images.unsplash.com/photo-1625296048730-ada61dcf378b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"/>
        </div>

        <div className="galery-item">
          <img src="https://images.unsplash.com/photo-1625296048730-ada61dcf378b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"/>
        </div>

        <div className="galery-item">
          <img src="https://images.unsplash.com/photo-1625296048730-ada61dcf378b?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80"/>
        </div>

      </div>

    </div>
  );
}

export default Galery;
